import "./item-to-replace.style.scss";
import Korn from "../../assets/korn.jpg";

const ItemToReplace = ({}) => {
    return ( 
        <div className="item-frame">
            <span>headline</span>
            <img src={Korn} alt="brenflex" />
            <p>details</p>
            <p>price and quantity</p>
        </div>
     );
}
 
export default ItemToReplace;
